import "./App.css";
import Data from "./components/Data";

function App() {
  return (
    <div class="row">
      <div class="table-responsive">
        <div class="col-md-6">
          <table class="table table-hover table-sm table-dark">
            {Data.map((value) => {
              return (
                <tbody>
                  <tr>
                    <td>{value.genre}</td>
                  </tr>
                </tbody>
              );
            })}
          </table>
        </div>
        <div class="col-md-6">
          <table class="table table-dark mt-80">
            <thead>
              <tr>
                <th scope="col">Title</th>
                <th scope="col">Genre</th>
                <th scope="col">Stock</th>
                <th scope="col">Rate</th>
                <th scope="col"> </th>
              </tr>
            </thead>

            <tbody>
              {Data.map((index) => {
                return (
                  <>
                    <tr>
                      <td>{index.title}</td>
                      <td>{index.genre}</td>
                      <td>{index.stock}</td>
                      <td>{index.rate}</td>
                      <td>
                        <button>Delete</button>
                      </td>
                    </tr>
                  </>
                );
              })}
              ;
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default App;
